import React from 'react'
import Login from './Login'
import Section1 from '.Section1'

class Nav extends React.Component{
    constructor(){
        super();
        this.state={
            display:false
        }
        this.LogIn=this.LogIn.bind(this);
    }
    LogIn=()=>{
        console.log('Clicked')
        {this.state.display===false?this.setState({display:true}):this.setState({display:false})}
    }
    render(){
        return(
            <div>
            <div id='Nav'>
                <button className='userbtn' onClick={this.LogIn}>LogIn</button>
                <button  className='userbtn'>SignUp</button>
            </div>
            <div>
                {this.state.display?<Login />:<div></div>}
            </div>
            <Section1 />
            </div>
        )
    }
}
export default Nav
